      <div>
        <center>This is a news item</center>
        <About
          title="new"
          desc="description"
          imgurl="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ2dVbLMzlaeJnL5C6RpZ8HLRECJhH6ILEGKg&s"
        />
        <About />
        <About />
        <About />
      </div>
    );
  }
}

export default Mains;
